import './Header.css'
import {Link} from 'react-router-dom';


function Header(){
    return(
        <div>
            <div className='header'>
                <Link to="/home">HOME</Link>
                <span className='mt-3'>Sell & Purchase ONLINE...</span>

                <Link to="/login">LOGIN</Link>
            </div>
        </div>
    )
}

export default Header;
